// frontend/src/App.js
import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import LoginPage from "./pages/LoginPage";
import AdminDashboard from "./pages/AdminDashboard";
import DevDashboard from "./pages/DevDashboard";
import UserDashboard from "./pages/UserDashboard";
import UserCreationForm from "./pages/UserCreationForm";
import ManageUsers from "./pages/ManageUsers";
import ManageItems from "./pages/ManageItems"; // ✅ NEW
import ItemHistory from "./pages/ItemHistory";

import './index.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<LoginPage />} />
        <Route path="/admin-dashboard" element={<AdminDashboard />} />
        <Route path="/admin-dashboard/manage-users" element={<UserCreationForm />} />
        <Route path="/admin-dashboard/users" element={<ManageUsers />} />
        <Route path="/admin-dashboard/items" element={<ManageItems />} /> {/* ✅ NEW ROUTE */}
        <Route path="/dev-dashboard" element={<DevDashboard />} />
        <Route path="/user-dashboard" element={<UserDashboard />} />
        <Route path="/admin-dashboard/items/:barcode" element={<ItemHistory />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
